import React from "react";
import AnimeSidebar from "../components/sidebars/AnimeSidebar";
import Navbar from "../components/navbar/Navbar";

const AnimeHome = () => {

  return (
    <div>
      <Navbar></Navbar>
      <AnimeSidebar></AnimeSidebar>
      <div>
        <div className="my-slider">
          <div>Slide 1</div>
          <div>Slide 2</div>
          <div>Slide 3</div>
        </div>
      </div>
    </div>
  );
};

export default AnimeHome;
